'''Lê Hữu Sinh''' (sinh 1949) là [[đại biểu Quốc hội Việt Nam]] [[Quốc hội Việt Nam khóa XI|khóa XI]], thuộc đoàn đại biểu [[Thanh Hóa|Thanh Hoá]].<ref>{{chú thích web|url=http://dbqh.na.gov.vn/XI/Daibieu.aspx|title=Danh sách Đại biểu Quốc hội khóa XI|accessdate=ngày 6 tháng 9 năm 2012|archive-date=2013-01-16|archive-url=https://web.archive.org/web/20130116064410/http://dbqh.na.gov.vn/XI/Daibieu.aspx}}</ref>

Ông là Ủy viên BTV tỉnh ủy, Ủy viên Ủy ban nhân dân tỉnh, Phó Bí thư Đảng ủy quân sự, Đại tá, Chỉ huy trưởng Bộ chỉ huy Quân sự tỉnh Thanh Hóa.<ref>{{Chú thích web |url=http://dbqh.na.gov.vn/daibieu/56/0000000348/Le-Huu-Sinh.aspx |ngày truy cập=2015-12-29 |tựa đề=Thông tin đại biểu |archive-date=2016-03-04 |archive-url=https://web.archive.org/web/20160304113648/http://dbqh.na.gov.vn/daibieu/56/0000000348/Le-Huu-Sinh.aspx }}</ref>

